                <p class="MsoNormal" align="center" style="margin-bottom: 6.4pt; text-align: center; line-height: normal;"><b><span lang="EN-US" style="font-size: 15pt; font-family: Arial, sans-serif;">Voodland</span></b><b><span style="font-size: 15pt; font-family: Arial, sans-serif;">.</span></b><b><span lang="EN-US" style="font-size: 15pt; font-family: Arial, sans-serif;">com</span></b><b><span lang="EN-US" style="font-size: 15pt; font-family: Arial, sans-serif;">&nbsp;</span></b><b><span style="font-size: 15pt; font-family: Arial, sans-serif;">– выбор и покупка растений от проверенных поставщиков</span></b></p><p class="MsoNormal" style="margin-bottom: 6.4pt; line-height: normal;"><span style="font-size: 10.5pt; font-family: Arial, sans-serif;">Где купить растения&nbsp;</span><span style="font-family: Arial, sans-serif; font-size: 14px;">действительно качественные здоровые</span><span style="font-family: Arial, sans-serif; font-size: 10.5pt;">, при этом выбрав нужный размер самого растения по приемлемой цене? Это волнует каждого покупателя согласитесь? Конечно можно отправиться в питомник, садовый центр или выбрать растения онлайн и купить в интернете или же побывать на специализированных ярмарках и выставках, выбрать и купить понравившееся растение там.</span></p><p class="MsoNormal" style="margin-bottom: 6.4pt; line-height: normal;"><span style="font-size: 10.5pt; font-family: Arial, sans-serif;"><br></span><b><span lang="EN-US" style="font-size: 10.5pt; font-family: Arial, sans-serif;">Voodland</span></b><b><span style="font-size: 10.5pt; font-family: Arial, sans-serif;">.</span></b><b><span lang="EN-US" style="font-size: 10.5pt; font-family: Arial, sans-serif;">com</span></b><b><span lang="EN-US" style="font-size: 10.5pt; font-family: Arial, sans-serif;">&nbsp;</span></b><span style="font-size: 10.5pt; font-family: Arial, sans-serif;">– это платформа созданная для всех кто так или иначе связан с "зеленой индустрией", объединяющая в себе предложения от поставщиков посадочного материала, которых мы в буквальном смысле отбираем прежде чем разметить их предложения на нашем сайте. Мы на собственном опыте, накопленном уже в течение 7-ми лет на рынке дистанционной торговли посадочным материалом, узнали какие вопросы и проблемы волнуют покупателей и поставщиков в "зеленой индустрии" при взаимодействии друг с другом во время продажи/покупки посадочного материала и постарались упростить это самое взаимодействие, забирая на себя риски для сторон.&nbsp;</span><span style="font-family: Arial, sans-serif; font-size: 10.5pt;">Мы продолжаем улучшать наш сервис и критерии отбора для каждого поставщика при этом упрощая процесс формирования и оплаты заказов и их доставку, улучшая качество посадочного материала, который мы предлагаем в каталоге нашего сайта покупателям.&nbsp;</span><span style="font-family: Arial, sans-serif; font-size: 10.5pt;">У нас вы сможете найти, выбрать и купить растения как редкие так и видовые для лесовосстановления и озеленения дворовых и промышленных территорий.</span></p><p class="MsoNormal" style="margin-bottom: 6.4pt; line-height: normal;"><span style="font-family: Arial, sans-serif; color: inherit; font-size: 15px;">Подходя к своему делу ответственно и осознавая хрупкость и уязвимость нашего товара мы знаем как ускорить получение целыми и невредимыми заказов нашими покупателями, обеспечивая постоянно высокое качество посадочного материала, достаточно стабильные рыночные цены и гарантируя отсутствие рисков для каждой из сторон сделки.&nbsp;&nbsp;<br></span><span style="font-family: Arial, sans-serif; font-size: 15px;"><b>Благодарим вас за доверие к нам мы постараемся оправдать ваш выбор!&nbsp;</b></span></p><h1 style="text-align: center;"></h1></div>
